// src/components/StuSignIn.js
import React, { useState } from 'react';
import { getAuth, signInWithEmailAndPassword, signInWithPopup, GoogleAuthProvider, FacebookAuthProvider } from 'firebase/auth';
import './StaffAuth.css'; // Import the CSS for styling

const StuSignIn = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [errors, setErrors] = useState({});
  const auth = getAuth();

  const handleSubmit = (e) => {
    e.preventDefault();
    const formErrors = {};
    const emailDomain = '@skcet.ac.in';

    // Email validation for @skcet.ac.in domain
    if (!email) {
      formErrors.email = "Email is required";
    } else if (!email.endsWith(emailDomain)) {
      formErrors.email = `Only ${emailDomain} email addresses are allowed`;
    }

    if (!password) formErrors.password = "Password is required";

    if (Object.keys(formErrors).length === 0) {
      // Firebase sign-in with email and password
      signInWithEmailAndPassword(auth, email, password)
        .then((userCredential) => {
          console.log("Signed in with:", { email, password });
          // Redirect after successful sign-in
          window.location.href = '/';
        })
        .catch((error) => {
          console.error("Error signing in:", error);
          setErrors({ form: "Invalid email or password" });
        });
    } else {
      setErrors(formErrors);
    }
  };

  const handleRedirect = (url) => {
    window.location.href = url; // Redirect to the specified URL
  };

  // Google Sign-In
  const handleGoogleSignIn = () => {
    const provider = new GoogleAuthProvider();
    signInWithPopup(auth, provider)
      .then((result) => {
        console.log("Google sign-in success:", result);
        // Redirect to home or dashboard
        window.location.href = '/';
      })
      .catch((error) => {
        console.error("Google sign-in error:", error);
      });
  };

  // Facebook Sign-In
  const handleFacebookSignIn = () => {
    const provider = new FacebookAuthProvider();
    signInWithPopup(auth, provider)
      .then((result) => {
        console.log("Facebook sign-in success:", result);
        window.location.href = '/';
      })
      .catch((error) => {
        console.error("Facebook sign-in error:", error);
      });
  };

  return (
    <>
      <div className="auth-page">
        <h1 className="page-title">Student Sign In</h1>
        <form className="auth-form" onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            {errors.email && <span className="error">{errors.email}</span>}
          </div>
          <div className="form-group">
            <label htmlFor="password">Password</label>
            <input
              type="password"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            {errors.password && <span className="error">{errors.password}</span>}
          </div>
          {errors.form && <span className="error">{errors.form}</span>}
          <button type="submit" className="auth-button">Sign In</button>
        </form>

        {/* Social Sign-In Options */}
        <div className="social-signin">
          <p>Or sign in with:</p>
          <button className="social-btn google-btn" onClick={handleGoogleSignIn}>Sign in with Google</button>
          <button className="social-btn facebook-btn" onClick={handleFacebookSignIn}>Sign in with Facebook</button>
        </div>

        <p className="toggle-link" onClick={() => handleRedirect('/signup')}>
          Don't have an account? Sign Up
        </p>
      </div>
    </>
  );
};

export default StuSignIn;
